FeedPackage.ReleaseNotes:
v3.34 - Added a new EagerLoadedJoin feature in the fluent mappings that creates a join relationship via the "JoinOne" or "JoinMany" methods in the FluentMappings class. - Added a new overload the the IDataMapper Queryable<T> method that takes a QueryBuilder<T> as an argument. This allows the user to build up the returned IQueryable<T> with some query defaults (such as the "Graph" levels to include in the resulting query).
v3.33 - Improved IQueryable Where clause expression parser so that it can handle a chain of nested property calls to unwrap the resulting parameter value. Example: .Where<User>(u => u.UserName == User.Identity.Name) - Added an UnsupportedException if user tries to include a function call in their Where expression. The exception provides brief user-friendly instructions to replace the function call with the resulting value. Example of an unsupported call: .Where<User>(u => u.UserName = GetCurrentUserName());
v3.30 - now implements IQueryable<T>. (Previous versions implemented standard Linq methods, as well as some more customized methods (like .AndWhere), but did not actually implement IQueryable<T>. The more powerful db.Query<T>() is still available for the most control. db.Queryable<T>() will return the IQueryable<T> implementation.) - Eager loaded and lazy loaded fields now honor the Graph query method: db.Query().Graph(...) Summary: calling Query<T>() without .Graph(...) only loads the root level entities. Adding .Graph() with no parameters will load all child relationships. Adding .Graph(...) with one or more child entity lambda expressions will load only the explicitly specified child relationships.
